import React from "react";

const Contacts = ({ contacts, deleteContact }) => {
  return (
    <ul>
      {contacts.map((contact) => {
        return (
          <li key={contact.name}>
            {contact.name} {contact.number}
            <button onClick={() => deleteContact(contact.id)}>Delete</button>
          </li>
        );
      })}
    </ul>
  );
};

export default Contacts;
